import React from "react";
import { withStyles } from "@material-ui/core/styles";
import styles from "./styles/CustomLessonEventStyles";

const LessonEvent = ({ event, classes }) => (
  <div className={classes.style}>
    <div>{event.title}</div>
    <span style={{ fontWeight: "600" }}>{event.room}</span>
  </div>
);
export default withStyles(styles)(LessonEvent);
